string int2hex(int i)
{
  std::stringstream stream;
  stream << hex << i;

  string result = stream.str();
  if (result.length() < 5) {
    result.insert(result.begin(), '0');
  }

  return result;
}

int hex2int(string hex_) {
  std::stringstream stream;
  stream << hex << hex_;

  int result;
  stream >> result;

  return result;
}

